import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HomePage from './HomePage';
import CreateProjectPage from './CreateProjectPage';
import DependenciesCheckPage from './DependenciesCheckPage';
import ProjectDetailsPage from './ProjectDetailsPage';
import './App.css'; // Общие стили для приложения

function App() {
    return (
        <Router>
            <div className="App">
                <nav className="navbar">
                    <Link to="/" className="nav-link">Главная</Link>
                    <Link to="/create-project" className="nav-link">Создать проект</Link>
                    <Link to="/check-dependencies" className="nav-link">Проверка зависимостей</Link>
                </nav>

                <div className="content">
                    <Routes>
                        <Route path="/" element={<HomePage />} />
                        <Route path="/create-project" element={<CreateProjectPage />} />
                        <Route path="/check-dependencies" element={<DependenciesCheckPage />} />
                        <Route path="/project/:projectId" element={<ProjectDetailsPage />} />
                        {/* Добавьте другие маршруты здесь, если потребуется */}
                    </Routes>
                </div>
            </div>
        </Router>
    );
}

export default App;
